  const updatingData = [
    {
      name: 'onlene-store',
      href: 'https://github.com/barrystone/online-store',
      class: 'project__item--big',
    },
  ];

  return (
    <div className='project__content'>
      <ul>
        <li>
          <a
            href='https://github.com/barrystone/online-store'
            className='project__item--big'
          >
            onlene-store
          </a>
        </li>
        <li>
          <a
            href='https://github.com/barrystone/dev-social-network-community'
            className='project__item--small'
          >
            dev-social-network-community
          </a>
        </li>
      </ul>
    </div>
  );
};

export default projectContent;
